import React from "react";
import './headerMain.css';

function HeaderMain(){
    return(
        <header className="header-main">
                <nav className="header-nav">
                    <li key={1} className="header-nav-li"><a className="header-nav-li-a" href="#home"><i className="fi fi-rr-house-chimney"></i></a></li>
                    <li key={1} className="header-nav-li"><a className="header-nav-li-a" href="#aboutMe"><i className="fi fi-rr-user"></i></a></li>
                    <li key={1} className="header-nav-li"><a className="header-nav-li-a" href="#education"><i className="fi fi-rr-graduation-cap"></i></a></li>
                    <li key={1} className="header-nav-li"><a className="header-nav-li-a" href="#skills"><i className="fi fi-rr-head-side-brain"></i></a></li>
                    <li key={1} className="header-nav-li"><a className="header-nav-li-a" href="#projects"><i className="fi fi-rr-document"></i></a></li>
                    <li key={1} className="header-nav-li"><a className="header-nav-li-a" href="#contact"><i className="fi fi-rr-envelope-download"></i></a></li>
                </nav>
        </header>
    );
};



export default HeaderMain;
